We will consider the following syllogism from Mill1851 , vol. 1, chap. 2: All men are mortal. Socrates is a man. Therefore, Socrates is mortal. This can be represented in the following Datalog textual program. human("Socrates"). mortal(X) <- human(X). ?- mortal("Socrates"). The execution of this program will start with the goal query " is Socrates mortal? " and in doing so will evaluate the necessary rule and derive the relation mortal . The result is a boolean value denoting whether the goal is satisfied. +------------+
| _: boolean |
+============+
| true |
+------------+ However, if we were to change the final query to replace the constant with a variable, as follows. ?- mortal(X). The program will select all matching (in this case all) facts from the mortal relation. +------------+
| X: string |
+============+
| "Socrates" |
+------------+ The following is the same example constructed via the ASDI library. use asdi::{NameReferenceSet, Program};
use asdi::edb::{Attribute, Predicate};
use asdi::idb::{Atom, Term, Variable};
use std::str::FromStr; let mut syllogism = Program::default(); let predicates = syllogism.predicates();
let p_human = predicates.fetch("human").unwrap();
let p_mortal = predicates.fetch("mortal").unwrap(); let human = syllogism .add_new_extensional_relation(p_human.clone(), vec![Attribute::string()]) .unwrap();
human.add_as_fact(["Socrates".into()]).unwrap(); let variables = syllogism.variables();
let var_x: Term = variables.fetch("X").unwrap().into(); syllogism .add_new_pure_rule( p_mortal.clone(), [var_x.clone()], [Atom::new(p_human, [var_x]).into()], ) .unwrap(); syllogism .add_new_query(p_mortal, ["Socrates".into()]) .unwrap(); The textual form of Datalog also has a set of pragmas, or directives, which allow us to specify details of the relations in our program. For example, in the text below we use the assert pragma to identify an EDB relation named "human" with a single column of type string. We then go on to use the infer pragma to identify an IDB relation named "mortal", and we declare that it's schema is the same as the EDB relation "human". .assert human(string).
.infer mortal from human. human("Socrates"). mortal(X) <- human(X). ?- mortal("Socrates").

